  return (
    <div style={{ marginLeft: "40%" }}>
      <h1>Ex1.0</h1>
      <Ex0 />
      <h1>Ex1.1</h1>
      <Ex1 />
      <h1>Ex1.2</h1>
      <MyButton text={appState.text} disabled={appState.disabled} />
      <MyList items={appState.items} />
